import React from 'react';
import Diapo from '../../data/diapo.json';

const {image} = Diapo;

const Main = (props) => {

  return (
    <main className="container row">
      <div className="">
        {
          Diapo.image(JSON).map((img,k) => {
            {JSON[key].type}
            return <img key={k}
              alt={img.alt}
              className={img.selecteur}
              src={JSON[key].url} />
           })
        }
    </div>
  </main>
)
}

export default Main;
